if mibBuilder.loadTexts: ciscoMobilePolicyChargingControlMIB.setDescription('Mobile PCC Infrastructure built on top of Policy Shim Layer, is a common interface to send and receive PCC related messages for all gateway applications that implement Gx or Ty functionality. Gx is a reference point located between the Policy and Charging Rules Function (PCRF) and the Policy and Charging Enforcement Function (PCEF). Three types of networks namely, 3G UMTS, 4G LTE and 4G WiMax use the 3GPP Gx interface as the standard policy control interface, and CDMA networks use the 3GPP2 Ty interface for the same. This MIB contains the PCC configurations/statistics which are implemented on the Mobile PCC infrastructure. Abbreviations: AAA Authentication, Authorization and Accounting AVP Attribute Value Pair. CCA Credit Control Answer. CCR Credit Control Request. PCC Policy Control and Charging. PCEF Policy and Charging Enforcement Function. PCRF Policy and Charging Rules Function. RAA Re-Authorization Answer. RAR Re-Authorization Request. CP Control Processor. TP Traffic Processor. Preload Object refers to the billing-plans, content-policies, billing-services, accounting policy-maps and service-contents downloaded during PCC through the Gx interface.')
